import Header from './Header';
import Footer from './Footer';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD',
};

export default function Layout(props) {
  return (
    <Row gutter={{xs: 8, sm: 16, md: 24, lg: 32}}>
      <Col className="gutter-row" span={16}>
        <Header />
        {props.children}
        <Footer />
      </Col>
    </Row>
  );
}
